import './index.css';
import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Sidebar } from './components/Sidebar';
import { Layout } from './components/Layout';
import { Home } from './components/Home/Home';
import { HazardReportForm}  from './components/Dashboard/HazardRiskManagements';
import  RiskAssessmentForm  from './components/Dashboard/HealthAndSafety';
import IncidentInvestigationForm from './components/Dashboard/IncidentsInvestigationForm';
import  ScienceLabForm from './Forms/ScienceLabForm'
import SwimmingPoolForm from './Forms/SwimmingPoolForm'
import PPEForm from './Forms/PPEForm'
import { Contacts } from './components/Pages/Contacts';
import { Products } from './components/Pages/Products';
import { Solutions } from './components/Pages/Solutions';
import SignIn from './components/Pages/SignIn'
import { PublicLayout } from './components/PublicLayout';
import  {HazardDashboard}  from './components/Dashboard/HazardDashboard';
import InspectionForm from './components/Dashboard/InspectionDashboard'
import CanteenForm from './Forms/CanteenForm';
import FuelStorageForm from './Forms/FuelStorageForm';
import HandAndPowerForm from './Forms/ToolInspectionForm';
import LogIn from './components/Pages/LogIn';
import VehicleForm from './Forms/VehicleForm';
import VehicleInspectionDashboard from './Forms-interface/vehicle-interface';
import CanteenInterface from './Forms-interface/Canteen-interface';



export default function App() {
  const [sidebarToggle, setSidebarToggle] = useState(false);

  return (
    <Router>
      <Routes>
        {/* Home page with no sidebar */}

        <Route
  path="/"
  element={
    <PublicLayout>
      <Home />
    </PublicLayout>
  }
/>




        {/* Dashboard page with sidebar */}
        <Route
          path="/dashboard"
          element={
            <div className="flex">
              <Sidebar sidebarToggle={sidebarToggle} />

            </div>
          }
        />


<Route
  path="/hazard/dashboard"
  element={
    <Layout sidebarToggle={sidebarToggle} setSidebarToggle={setSidebarToggle}>
      <HazardDashboard />
    </Layout>
  }
/>



<Route
  path="/hazard/report"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <HazardReportForm />
    </Layout>
  }
/>

<Route
  path="/health-and-safety"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <RiskAssessmentForm />
    </Layout>
  }
/>

<Route
  path="/incident-management"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <IncidentInvestigationForm />
    </Layout>
  }
/>

<Route
  path="/inspection"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <InspectionForm />
    </Layout>
  }
/>






<Route
  path="/products"
  element={
    <PublicLayout>
      <Products />
    </PublicLayout>
  }
/>

<Route
  path="/solutions"
  element={
    <PublicLayout>
      <Solutions />
    </PublicLayout>
  }
/>

<Route
  path="/contacts"
  element={
    <PublicLayout>
      <Contacts />
    </PublicLayout>
  }
/>

<Route
  path="/signin"
  element={
    <PublicLayout>
      <SignIn />
    </PublicLayout>
  }
/>

<Route
  path="/login"
  element={
    <PublicLayout>
      <LogIn />
    </PublicLayout>
  }
/>

                <Route
  path="/form/hand-and-power"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <HandAndPowerForm />
    </Layout>
  }
/>



        <Route
  path="/form/canteen"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <CanteenForm />
    </Layout>
  }
/>

        <Route
  path="/form/fuel"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <FuelStorageForm />
    </Layout>
  }
/>

        <Route
  path="/form/ppe"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <PPEForm />
    </Layout>
  }
/>
        <Route
  path="/form/vehicle"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <VehicleForm />
    </Layout>
  }
/>


        <Route
  path="/form/science-laboratory"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <ScienceLabForm />
    </Layout>
  }
/>
        <Route
  path="/form/swimming-pool"
  element={
    <Layout
      sidebarToggle={sidebarToggle}
      setSidebarToggle={setSidebarToggle}
    >
      <SwimmingPoolForm />
    </Layout>
  }
/>
        <Route path="/forms-interface/vehicle-interface" element={<VehicleInspectionDashboard />} />
        <Route path='/forms-interface/canteen-interface' element={<CanteenInterface />} />
        {/* Add other routes here */}




      </Routes>
    </Router>
  );
}
